INSERT INTO `base_question` VALUES ('10', '4.参加模拟公考需要交报名费吗？', null, null, '<p>报名参加模拟公考是免费的。</p>', 'Y', '4', null, '2021-09-15 10:39:31', null, null);
INSERT INTO `base_question` VALUES ('11', '5.模拟公考的考试形式', null, null, '<p>本次模拟公考为线下考试，考试分为行测和申论两部分。</p>', 'Y', '5', null, '2021-09-15 10:44:46', null, null);
INSERT INTO `base_question` VALUES ('12', '6.模考报名后几天可查询具体的考试信息？', null, null, '<p>考生可于报名截止日后的（）个工作日内/（）月（）日查询具体考场信息。</p>', 'Y', '6', null, '2021-09-15 10:45:31', null, null);
INSERT INTO `base_question` VALUES ('13', '7.模拟公考考试有试题解析吗？', null, null, '<p>考生可在考试结束后通过“中国公考中心”微信小程序购买和学习试题解析。试题解析包含线上视频和纸质讲义，纸质讲义将在购买试题解析后的（）个工作日内为您邮寄。</p><p>&nbsp;</p>', 'Y', '7', null, '2021-09-15 10:46:01', null, null);
