INSERT INTO `base_shop_item` VALUES ('6', '细胞调理', '01', 'FYAN复颜--独家配方胶原和先进设备完美融合，运用独特手法调节细胞平衡，将 模拟生物微电演变成多种波形，分别针对皮肤的表皮层、真皮层、胶原层和皮 下肌肉组织进行训练和修复，平衡细胞膜值，活跃细胞，加速细胞分裂再生， 加速肌肤自身锁水能力，蛋白质合成能力及弹性纤维和胶原纤维的修复愈合能 力，从根本上改善皮肤的衰老及受损状态，让肌肤达到一种深层的改善和滋养', '990.00', null, null, 'https://api.zydan-yjt.com/profile/upload/2022/03/18/a256d4de-662a-4092-83b0-d2d9b45c4a4b.jpeg', 'https://api.zydan-yjt.com/profile/upload/2023/05/09/7686cb1f-2c95-47a3-9f3c-a104eac0266b.jpeg', '<p><img src=\"https://api.zydan-yjt.com/profile/upload/2023/05/09/cc4659c0-bd38-4df0-b8e4-743f33a25d8f.png\">FYAN复颜--独家配方胶原和先进设备完美融合，运用独特手法调节细胞平衡，将模拟生物微电演变成多种波形，分别针对皮肤的表皮层、真皮层、胶原层和皮下肌肉组织进行训练和修复，平衡细胞膜值，活跃细胞，加速细胞分裂再生，加速肌肤自身锁水能力，蛋白质合成能力及弹性纤维和胶原纤维的修复愈合能力，从根本上改善皮肤的衰老及受损状态，让肌肤达到一种深层的改善和滋养。 </p><p><br></p><p>功效：</p><p>促进细胞分裂再生、 帮助受损肌肤恢复自身修复能力。加速面部血液循环，使皮肤恢复正常的新陈代谢与循环。</p><p>仪器会发出一种微电干扰抑制络氨酸酶（合成黑色素的关键酶）的活性，进而分解皮肤黑色素，淡化黑斑，改善色素沉着，提亮肤色。</p><p>刺激高尔基腱（一种来自于大脑的，对肌肉进行控制的网状神经）训练面部肌肉、塑造面部轮廓，恢复皮肤的柔韧性，令皮肤禁止光泽有弹性。</p><p><br></p><p>胶原成分：</p><p>柑橘提取物、天竺葵提取物、胡萝卜提取物 、植物纤维素、透明质酸，银耳多糖</p>', 'Y', '1', '0.12', '0.10', '0.08', '0.00', 'N', '0', '01', '2021-12-29 09:40:14', null, '2023-07-04 18:46:02', null);
INSERT INTO `base_shop_item` VALUES ('7', '淋巴排毒', '01', '随着年龄增加，或长期生活不规律、睡眠不足而导致血液循环、淋巴液循环不 良，使面部毒素过多，皮肤出现水肿、晦暗、缺乏光泽、出现眼袋、起斑、缺 水、干燥起皱等问', '990.00', null, null, 'https://api.zydan-yjt.com/profile/upload/2022/03/19/62cf84c9-5d95-4bc0-88bc-9aada8b013b1.jpeg', 'https://api.zydan-yjt.com/profile/upload/2023/05/09/b3d181f1-d24e-4c3c-9ca9-aa8ef227c4da.jpeg', '<p><img src=\"https://api.zydan-yjt.com/profile/upload/2023/05/09/5b5a70f2-3031-457f-a3de-314ade585f5d.png\"></p><p>随着年龄增加，或长期生活不规律、睡眠不足而导致血液循环、淋巴液循环不良，使面部毒素过多，皮肤出现水肿、晦暗、缺乏光泽、出现眼袋、起斑、缺水、干燥起皱等问题。</p><p><br></p><p>FYAN复颜—独家配方胶原和先进设备仪器，配合独特按摩手法，使用专用通电手套携带微电流，带动及加速面部皮下淋巴管道内的废水循环，使之快速地循环到腋下淋巴结，再通过尿液及汗液排出体外，从而加速面部的新陈代谢。</p><p>并有效淡化痘印，去除水肿，代谢面部深层激素及其它有害皮肤的物质，去除和预防水肿，紧致面部轮廓；提亮肤色，保持良好的新陈代谢。</p><p><br></p><p>胶原成分：</p><p>冬瓜提取物、洋甘菊提取物、植物纤维素、透明质酸、银耳多糖</p>', 'Y', '1', '0.12', '0.10', '0.08', '0.00', 'N', '0', '01', '2021-12-29 09:41:36', null, '2023-07-04 18:46:31', null);
INSERT INTO `base_shop_item` VALUES ('8', '负压淋巴排毒', '01', '随着年龄增加，或者长期生活不规律、睡眠不足而导致血液循环、淋巴液循环不 良，使面部毒素过多，皮肤出现水肿、晦暗、缺乏光泽、出现眼袋、起斑、缺水、 干燥起皱等问题', '799.00', null, null, 'https://api.zydan-yjt.com/profile/upload/2022/03/19/64af4e3b-8d18-4cec-8cde-8c9d0b6b8c62.jpeg', '', '<p><img src=\"https://api.zydan-yjt.com/profile/upload/2023/05/09/2d90dc6f-1d32-435f-bae4-25eed7d1cdcc.png\"></p><p><br></p><p>利用探头上的走珠及仪器输出的稳定气压作轻柔式淋巴输送，令面部及身体内的深层结缔组织及淋巴系统得到深度按摩，强化组织机能，促进血液和淋巴循环，排除体内多余的水分和毒素，强化胶原蛋白和弹性蛋白，促进新陈代谢，改善肤质，平滑肌肤，增加皮肤弹性，以此达到收紧去皱、重塑面部轮廓与体型的功效。</p>', 'N', '1', '0.12', '0.10', '0.08', '0.00', 'N', '0', '01', '2021-12-29 09:42:56', null, '2023-07-04 18:46:57', null);
INSERT INTO `base_shop_item` VALUES ('10', '梅花绣', '01', '运用梅花针对面部穴位和病灶部位刺激，疏通经络，排除循环障碍，促进血液循环，使颜面五官部位气血通畅，刺激皮肤生成胶原蛋白，加快血液的营养供应。梅花针在皮肤表层建立大量的皮肤微细管道，使中药腌制的梅花水和梅花油有效快速地渗入皮肤深层，修复受损及衰老的皮肤。', '1990.00', null, null, 'https://api.zydan-yjt.com/profile/upload/2022/03/19/867bac80-76a5-4b48-8cf0-b2db0be45f2f.jpeg', 'https://api.zydan-yjt.com/profile/upload/2023/05/09/671e1e64-1d31-43da-b5fd-ad2fa433985d.jpg', '<p><img src=\"https://api.zydan-yjt.com/profile/upload/2023/05/09/c0c68a5c-4842-45e2-9710-39e36f4cfe60.png\">FYAN复颜梅花绣——隶属刺络疗法，其源远流长，刺络疗法早在新石器时代,就有利用砭石刺破皮肤放血而治病的方法。</p><p>梅花绣是在中医学理论指导下建立起来的一套独特的针对面部痘疮/痘印/痘坑/皮肤松弛的治疗体系。</p><p>是针对痘疮的进一步修复体系，并且对晒斑、黄褐斑有验证疗效，持续治疗下能紧致毛孔，有效延缓皮肤衰老。运用梅花针对面部及病灶部位刺激，疏通经络，排除循环障碍，促进血液循环，使颜面五官部位气血通畅，刺激皮肤生成胶原蛋白，加快血液的营养供应。</p><p><br></p><p>抗衰：随着年龄增长，自然衰老，皮肤供养能力变弱，吸收能力不足，会出现一定程度的松弛,皱纹等衰老状态。</p><p><br></p><p>修复受损肌肤：因长期不当使用化妆品，尤其是含激素的护肤品，导致肌肤的新陈代谢受到抑制，皮肤各层的功能从内而外依次受到越来越严重的损害，使得皮肤新陈代谢变慢，深层的毒素垃圾无法正常排出，同时皮肤外部吸收受到影响。</p><p><br></p><p>梅花油功效：滋养皮肤，促进皮肤细胞生长。</p><p>梅花油成分：黑芝麻，白芝麻，乌枣，葡萄皮，玉竹，冬虫夏草。</p><p>梅花水成分:  去离子水，银杏，百合，白葡萄籽，玉竹。</p><p>梅花水作用：镇静，保湿。</p><p><br></p><p>作用：淡化色斑，紧致毛孔，去除痘坑，淡化皱纹，抗衰老，使皮肤细腻光滑。</p><p><br></p><p>梅花绣和微针的区别在哪？</p><p><br></p><p>配合使用的产品不同</p><p>梅花绣起源于中国的梅花针，梅花油是由黑芝麻白芝麻油腌制冬虫夏草多种名贵中药古法炮制半年以上而得的，可以有效修复受损肌肤，滋养皮肤，促进皮肤细胞生长的作用。</p><p><br></p>', 'Y', '2', '300.00', '300.00', '300.00', '300.00', 'N', '0', '01', '2022-03-19 10:11:06', null, '2023-07-04 18:47:50', null);
INSERT INTO `base_shop_item` VALUES ('11', '氢氧泡泡清洁', '01', '利用真空负压技术，清洁头中央的喷射口喷射出溶液，柔和的去除肌肤各种代谢物，通过清洁头边缘吸口被清除。', '398.00', null, null, 'https://api.zydan-yjt.com/profile/upload/2022/03/19/701b3e61-ed14-4579-9991-9b1ae5ef5272.jpeg', 'https://api.zydan-yjt.com/profile/upload/2023/05/09/b92372e9-dd3e-46d3-a35f-5031d9683314.jpeg', '<p><img src=\"https://api.zydan-yjt.com/profile/upload/2023/05/09/12558d1b-c51f-48b0-a869-a20a4405afca.png\">利用真空负压技术，清洁头中央的喷射口喷射出溶液，柔和的去除肌肤各种代谢物，通过清洁头边缘吸口被清除。</p><p><br></p><p>S1溶液（水果提取/水溶性）——存在于自然的果酸统称为AHA，具有易溶于水的特征.，自公元前便被使用于肌肤美容，并被广泛用于安全并有效的去角质 </p><p><br></p><p>S2溶液（植物提取/脂溶性）——作为脂溶性物质，容易渗透肌肤，使角质细胞间的结合加速化，防止角质层的形成，对痘肌管理很有效果。</p><p><br></p><p>S3溶液（保湿成分）——被广泛用于保湿效果的透明质酸以及具有卓越镇定效果的马齿莲提取物，</p><p>都可在操作后对肌肤进行镇定。</p>', 'Y', '1', '0.12', '0.10', '0.08', '0.00', 'N', '0', '01', '2022-03-19 10:15:13', null, '2023-07-04 18:48:20', null);
INSERT INTO `base_shop_item` VALUES ('12', '纯氧美肌', '01', '氧气是生命之源，我们的皮肤也需要氧气，真皮层会通过毛细血管来输送氧气，使每一个细胞都得到健康生长。随着年龄的增长，微血管老化，皮肤吸收养分的能力变慢，细胞缺氧造成细胞新陈代谢速度减缓，导致胶原及弹力纤维减少，皮肤幼纹松弛，色素不均，斑点黑眼圈等皮肤问题出现。', '689.00', null, null, 'https://api.zydan-yjt.com/profile/upload/2022/03/19/76c8c4ef-5ced-4786-82af-76d60b361cc5.jpeg', 'https://api.zydan-yjt.com/profile/upload/2022/03/21/ddf355b8-0651-490f-b66b-c572fb61c241.jpeg', '<p><img src=\"https://api.zydan-yjt.com/profile/upload/2023/05/09/a607fecb-df3e-47a1-bfce-a8b14d0abb73.png\"></p><p>氧气是生命之源，我们的皮肤也需要氧气，真皮层会通过毛细血管来输送氧气，使每一个细胞都得到健康生长。随着年龄的增长，微血管老化，皮肤吸收养分的能力变慢，细胞缺氧造成细胞新陈代谢速度减缓，导致胶原及弹力纤维减少，皮肤幼纹松弛，色素不均，斑点黑眼圈等皮肤问题出现。</p><p><br></p><p>喷氧——特制的喷氧枪将95%以上的纯氧及活性物质以喷雾型式作用在皮肤表皮层，舒缓镇静，提亮肤色，清除自由基，形成表皮保护膜，有效预防手机、电脑和阳光等紫外线对皮肤的伤害，尤其适合清理暗疮及美容手术或激光手术后的护理，修复受损肌肤，改善皮肤暗黄状况，使肌肤嫩白通透。</p><p><br></p><p>皮肤里有一种细菌为厌氧菌，它会阻碍皮肤吸收养分，皮肤缺氧会缺乏活力，注氧可以杀死皮肤里面的厌氧菌，活跃细胞，代谢老化的细胞，做一次注氧可以增加肌肤30被的吸收能力。</p><p><br></p><p>注氧——通过无针头压力注氧方式将95%以上的纯氧及活性物质以高压注入皮肤基底层内，治疗及改善皮肤因缺氧而引起的肤色不均、皱纹、松弛、色素沉淀、皮肤老化等问题，深层抗衰老，增强细胞活性，提高肌肤自身免疫功能。</p>', 'Y', '1', '0.12', '0.10', '0.08', '0.00', 'N', '0', '01', '2022-03-19 10:15:58', null, '2023-07-04 18:48:46', null);
