INSERT INTO `base_text_content` VALUES ('1', '关于我们', '关于我们', '<p>	公务员考试是公务员主管部门组织录用担任一级主任科员以下及其他相当职级层次的公务员的录用考试。<span style=\"color: rgb(51, 102, 204);\">&nbsp;[11]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span></p><p>	《<a href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD%E5%85%AC%E5%8A%A1%E5%91%98%E6%B3%95/1279026\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">中华人民共和国公务员法</a>》规定录用担任一级主任科员以下及其他相当职级层次的公务员，采取公开考试、严格考察、平等竞争、择优录取的办法。<a href=\"https://baike.baidu.com/item/%E6%B0%91%E6%97%8F%E8%87%AA%E6%B2%BB%E5%9C%B0%E6%96%B9/10843555\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">民族自治地方</a>依照前款规定录用公务员时，依照法律和有关规定对少数民族报考者予以适当照顾。中央机关及其直属机构公务员的录用，由中央公务员主管部门负责组织。地方各级机关公务员的录用，由省级公务员主管部门负责组织，必要时省级公务员主管部门可以授权设区的市级公务员主管部门组织。</p>', 'Y', '', '2021-08-23 17:00:19', '', '2021-09-11 09:07:44');
INSERT INTO `base_text_content` VALUES ('2', '隐私协议', '隐私协议', '<p>隐私政	请您务必认真阅读本隐私政策，在确认充分了解并同意后使用百度百科服务。此隐私权政策旨在帮助您了解我们会收集哪些数据、为什么收集这些数据，会利用这些数据做些什么及如何保护这些数据。请您务必认真阅读本隐私政策，在确认充分了解并同意后使用百度百科服务。<strong>使用百度百科，即表示您同意百度百科隐私政策。</strong>如果您或您的监护人不同意本隐私政策的任何内容，您应该立即停止使用。</p><p>	请注意：您可以在百科个人中心-设置或产品功能中找到一些控制项，通过这些控制项，您可以对自己的信息进行动态管理。</p><p>	<strong>请注意：《百度隐私权保护声明》适用于百度集团所有产品和服务，如有本隐私政策未尽事宜，以《百度隐私权保护声明》为准，若本隐私政策和《百度隐私权保护声明》存在不一致，则优先适用本隐私政策。</strong></p><p>	<strong>请注意：当您通过百度百科使用第三方产品和服务时，如果向该第三方提供您的个人信息，您的信息将适用该第三方的隐私政策。</strong></p><p>	<strong>请注意：</strong>请您确保您向我们提供的个人信息，以及您授权我们在本隐私政策所述范围内收集、处理、使用、存储、共享、转让或公开披露相关个人信息，不会侵犯他人合法权益。</p><p>	本隐私政策将帮助您了解以下内容：</p><p>	1、我们如何收集和使用您的个人信息</p><p>	2、我们如何使用 Cookie 和同类技术</p><p>	3、我们如何共享、转让、公开披露您的个人信息</p><p>	4、我们如何保存及保护您的个人信息</p><p>	5、您的权利</p><p>	6、我们如何处理儿童的个人信息</p><p>	7、您的个人信息如何在全球范围转移</p><p>	8、隐私政策的修订</p><p>	9、如何联系我们</p><p>	我们深知个人信息对您的重要性，也深知为您的信息提供有效保护是我们业务健康可持续发展的基石。感谢您对百度百科的使用和信任！我们致力于维持您对我们的信任，恪守适用法律和我们对您的承诺，尽全力保证您的个人信息安全和合理使用。</p><p>	我们郑重承诺，<strong>我们将按业界成熟的安全标准，采取相应的安全保护措施来保护您的个人信息。</strong></p><p>	<strong>一、我们如何收集和使用您的个人信息</strong></p><p>	个人信息是指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息。</p><p>	（一） 百度百科业务功能</p><p>	百度百科业务功能包括词条搜索、词条浏览、词条编辑、使用百度百科商城消费、Ta说、搜索推荐：猜你关注、本人词条编辑、第三方服务推荐（均注明服务提供方）。</p><p>	（二） 为您提供我们的产品和服务</p><p>	为了向您提供，并使您获得更好、更个性化的产品和服务，当您使用我们的产品和服务时，我们会以下列方式收集和使用您的个人信息：</p><p>	1.您直接提供和我们自动采集的个人信息</p><p>	(1)<strong>注册信息</strong>。您使用百度百科服务，可以登录经注册的百度通用帐号。当您在百度百科注册百度通用账号时，您需向我们提供以下信息：帐号名称、头像、密保邮箱、密保手机、密保问题，并创建密码；当您直接在百度百科登录百度通用账号时，我们将自动收集您的上述信息。您也可以使用第三方帐号（如微信、微博、QQ）登录百度百科。此时，您将授权百度百科读取您在该第三方帐号注册的公开信息（昵称、头像等）。当然，您未登录百度百科，并不会妨碍您使用百度百科进行词条浏览及搜索，但可能会影响到您使用内容发布等需要经过实名认证才能使用的业务功能。</p><p>	<strong>当您使用百度百科特定业务功能时（如百度百科商城），为遵守国家相关规定并满足向您提供该产品和服务之目的，除注册信息外，您还需要进一步向我们提供包括但不限于您的姓名、住址、联系方式及其他为您提供服务所必须信息，</strong>如果您不使用特定产品和服务，则无需提供相关信息（以下将详细阐明）。</p><p>	百度百科会不时针对新推出的服务和功能发起运营活动，如果您参加相关运营活动，我们会通过运营活动界面收集包括但不限于您的身份信息、联系方式、交易帐号类信息，以便与您取得联系，向您发运营奖励等。若您不参加相关运营活动则无需提供前述信息。</p><p>	<strong>(2)设备和日志信息。</strong>当您使用百度百科的服务时，我们的服务器会自动记录您的日志信息，例如您输入的搜索关键词信息和点击的链接，您浏览和发布的词条及编辑记录，您上传的图片信息、您的IP 地址、浏览器的类型和使用的语言、硬件设备信息、操作系统的版本、网络运营商的信息、您访问服务的日期、时间、时长等。为了给您带来更便捷的搜索服务并不断完善百度百科产品及服务，我们可能会使用浏览器网络存储等机制（包括HTML5）和应用数据缓存，收集您设备上的信息并进行本地存储。</p><p>	(3)<strong>发布内容</strong>。您在使用百度百科的服务时，为履行法律法规要求的信息发布审核、内容管理责任，我们会收集、存储和分析您通过百度百科平台上传和发布的内容（包括词条和文章内容、您上传的视频内容）。您在使用我们的产品和服务时由您主动上传或发布的内容和信息，会使公众可访问，请您谨慎对待。</p><p>	2.我们间接收集的您的信息</p><p>	为共同向您提供产品和服务，或改进产品和服务的质量和个性化程度，或出于对产品和服务安全性的考量等合理需要，我们将按照法律法规的规定或基于您的授权。从关联公司、合作伙伴及其他受信任的第三方供应商处接收您的个人信息及其他信息，并依照您与第三方的约定或本隐私政策使用您的个人信息，两者出现冲突以本隐私政策为准。</p><p>	（三） 为您展示和推送定制内容</p><p>	我们会基于收集的信息，对您的偏好、习惯作特征分析和用户画像，以便为您提供更适合您的定制化服务，例如向您展现或推荐相关程度更高（而非普遍推送）的搜索结果、信息流或者广告/推广信息结果。</p><p>	我们可能向您推荐您可能感兴趣的内容，包括但不限于向您发出产品和服务信息，或通过系统向您展示个性化的第三方推广信息，或者在征得您同意的情况下与百度关联方及合作方共享以便他们向您发送有关其产品和服务的信息。</p><p>	我们可能会将您在百度百科中的画像信息与您在其他百度服务中的信息（包括个人信息）结合起来，以便百度整体能更好地满足您的需求。</p><p>	（四） 改善百度的产品和服务，开展内部审计、数据分析和研究</p><p>	我们使用收集的信息来提供并改进我们及百度关联方提供的产品和服务，并进行必要的业务运营，例如运营产品或提供服务、评估、维护和改进产品和服务的性能，参与有关我们产品和服务的市场调查活动，开发新的产品和服务、提供客户支持等。</p><p>	为改进我们及百度关联方的产品和服务，我们也可能会对产品使用情况进行内部审计、统计和分析。同时，百度可能会与公众共享这些统计信息，以展示我们服务的整体使用趋势，但这些统计信息将不会包含您的任何身份识别信息。</p><p>	（五） 个人信息的匿名化处理</p><p>	在收集到您的个人信息后，我们将通过技术手段及时对数据进行去标识化处理和/或匿名化处理。在不泄露您个人信息的前提下，百度有权对匿名化处理后的用户数据库进行挖掘、分析和利用（包括商业性使用）。</p><p>	（六） 为您提供安全保障</p><p>	我们可能使用您的信息用于安全防范和诈骗监测等，以预防、发现、调查欺诈、危害安全、非法或违反与我们的协议、政策或规则的行为，以保护您、我们或我们的关联公司、合作伙伴及社会公众的合法权益。 （七） 您授权我们在您使用百度百科产品及服务的期间使用您的个人信息，若您注销帐号，我们将停止使用并删除您的个人信息或对您的个人信息进行匿名化处理。</p><p>	（八） 事先征得授权同意的例外</p><p>	1.<strong>请注意，在以下情形中，收集、使用个人信息无需事先征得您的授权同意：</strong></p><p>	(1) 与国家安全、国防安全直接相关的；</p><p>	(2) 与公共安全、公共卫生、重大公共利益直接相关的；</p><p>	(3) 与犯罪侦查、起诉、审判和判决执行等直接有关的；</p><p>	(4) 出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</p><p>	(5) 所收集的个人信息是您自行向社会公众公开的；</p><p>	(6) 从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道；</p><p>	(7) 根据您的要求向您提供产品或服务所必需的；</p><p>	(8) 用于维护所提供的产品或服务的安全稳定运行所必需的，例如发现、处置产品或服务的故障；</p><p>	(9) 法律法规规定的其他情形。</p><p>	（九）<strong>当我们要将信息用于本隐私政策未载明的其它用途时，会事先征求您的同意。当我们要将基于特定目的收集而来的信息用于其他目的时，会事先征求您的同意</strong>。</p><p>	<strong>二、我们如何使用Cookie和同类技术</strong></p><p>	<strong>（一）Cookie</strong></p><p>	为确保网站正常运转，我们会在您的计算机或移动设备上存储名为 Cookie 的小数据文件。Cookie 通常包含标识符、站点名称以及一些号码和字符。Cookie主要的功能是便于您使用网站产品和服务，以及帮助网站统计独立访客数量等。运用Cookie技术，我们能够为您提供更加周到的个性化服务，并允许您设定您特定的服务选项。</p><p>	当您使用百度百科的产品和服务时，会向您的设备发送Cookie。当您与我们提供给合作伙伴的服务（例如广告和/或推广服务，以及可能显示在其他网站上的由百度百科提供的服务功能）进行交互时，我们允许Cookie（或者其他匿名标识符）发送给百度的服务器。</p><p>	我们不会将 Cookie 用于本隐私政策所述目的之外的任何用途。您可根据自己的偏好管理或删除 Cookie。有关详情，请参见 AboutCookies.org。您可以清除计算机上保存的所有 Cookie，大部分网络浏览器都设有阻止 Cookie 的功能。但如果您这么做，则需要在每一次访问我们的网站时亲自更改用户设置，但您可能因为该等修改，无法登录或使用依赖于Cookie的百度提供的服务或功能。</p><p>	您可以通过更改您的浏览器设置限制百度公司对Cookie的使用。以百度浏览器为例，您可以在百度浏览器右上方的下拉菜单的“浏览器设置”中，通过“隐私设置——清除浏览数据”，选择清除您的Cookie。如需详细了解其他浏览器如何更改浏览器设置，请参考该浏览器的帮助中心或其他相关功能指引页面，例如：https://support.google.com/chrome/search?q=cookie ；http://help.opera.com/opera/Windows/2393/en/controlPages.html#manageCookies。]</p><p>	<strong>（二）Do Not Track（请勿追踪）</strong></p><p>	很多网络浏览器均设有 Do Not Track 功能，该功能可向网站发布 Do Not Track 请求。当用户提出 “Do not track” 请求时，具有 “Do not track” 功能的浏览器会在http数据传输中添加一个“头信息”（headers），这个头信息向商业网站的服务器表明用户不希望被追踪，这样，遵守该规则的网站就不会追踪用户的个人信息来用于更精准的在线广告。目前，主要互联网标准组织尚未设立相关政策来规定网站应如何应对此类请求。但如果您的浏览器启用了 Do Not Track，那么百度平台的所有网站都会尊重您的选择。</p><p>	<strong>三、我们如何共享、转让、公开披露您的个人信息</strong></p><p>	<strong>（一）共享</strong></p><p><br></p><ol><li class=\"ql-indent-1\">我们会以高度的勤勉义务对待您的信息。<strong>在获得您的明确同意后，我们会与其他方共享您的个人信息</strong>。我们可能会根据法律法规规定，或按照法律法规、法律程序的要求或强制性的政府要求或司法裁定，对外共享您的个人信息。</li><li class=\"ql-indent-1\">便于我们基于关联账号共同向您提供服务，推荐您可能感兴趣的信息或保护百度关联公司或其他用户或公众的人身财产安全免遭侵害，<strong>我们可能会与关联公司共享您的个人信息。我们只会共享必要的个人信息（如为便于您使用百度账号使用我们关联公司产品和/或服务，我们会向关联公司共享您必要的账户信息）。</strong>如果改变个人信息的共享或使用和处理目的，将再次征求您的授权同意。</li><li class=\"ql-indent-1\">仅为实现本隐私政策中声明的目的，<strong>我们的某些服务将由授权合作伙伴提供。我们可能会与合作伙伴共享您的某些个人信息，以提供更好的客户服务和用户体验</strong>。我们仅会出于合法、正当、必要、特定、明确的目的共享您的个人信息，并且只会共享提供服务所必要的个人信息。我们的合作伙伴无权将共享的个人信息用于任何其他用途。</li><li><strong>您同意我们与如下几类第三方授权合作伙伴共享信息：</strong></li><li class=\"ql-indent-1\"><strong>广告、咨询类服务商/广告主。</strong>未经您授权，我们不会将您的个人信息与提供广告、咨询类服务商共享。但我们可能会将经处理无法识别您的身份且接收方无法复原的信息，例如经匿名化处理的用户画像，与广告或咨询类服务商或广告主共享，以帮助其在不识别您个人的前提下，提升广告有效触达率，以及分析我们的产品和服务使用情况等。</li><li class=\"ql-indent-1\">对我们与之共享个人信息的公司、组织和个人，我们会对其数据安全环境进行调查，与其签署严格的保密协定，要求他们按照我们的说明、本隐私政策以及其他任何相关的保密和安全措施来处理个人信息。</li><li><strong>您主动与他人共享的信息</strong></li><li>(1) 百度百科的成长离不开等各方用户达人的共同努力，我们非常感谢您对百度百科数据更新、使用反馈方面的贡献。</li><li class=\"ql-indent-1\">(2) 您可以利用百度百科的分享功能与您手机通讯录中的联系人、您的特定或不特定社交好友（如微信、微博）共享包括但不限于您的地理位置、您搜索的内容、您的词条贡献等个人信息。<strong>请您在分享前充分考虑信息接收人的信誉情况，并建议您查看您利用的社交网络或第三方服务提供商的隐私声明</strong>，以了解他们如何处理您的信息，以便审慎决策。</li></ol><p>	<strong>（二）转让</strong></p><p><br></p><ol><li>我们不会将您的个人信息转让给除<strong>百度关联公司</strong>外的任何公司、组织和个人，但以下情况除外：</li><li>(1) 事先获得您的明确授权或同意；</li><li>(2) 满足法律法规、法律程序的要求或强制性的政府要求或司法裁定；</li><li class=\"ql-indent-1\">(3) 如果我们或我们的关联公司涉及合并、分立、清算、资产或业务的收购或出售等交易，您的个人信息有可能作为此类交易的一部分而被转移，我们将确保该等信息在转移时的机密性，并尽最大可能确保新的持有您个人信息的公司、组织继续受此隐私政策的约束，否则我们将要求该公司、组织重新向您征求授权同意。</li></ol><p>	<strong>（三）公开披露</strong></p><p><br></p><ol><li><strong>我们仅会在以下情况下，公开披露您的个人信息：</strong></li><li>(1) 获得您的明确同意；</li><li class=\"ql-indent-1\">(2) 基于法律法规、法律程序、诉讼或政府主管部门强制性要求下。</li></ol><p>	<strong>（四）共享、转让、公开披露个人信息时事先征得授权同意的例外</strong></p><p><br></p><ol><li>在以下情形中，共享、转让、公开披露个人信息无需事先征得个人信息主体的授权同意：</li><li>(1) 与国家安全、国防安全直接相关的</li><li>(2) 与公共安全、公共卫生、重大公共利益直接相关的；</li><li>(3) 与犯罪侦查、起诉、审判和判决执行等直接相关的；</li><li class=\"ql-indent-1\">(4) 出于维护个人信息主体或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；个人信息主体自行向社会公众公开的个人信息；从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。</li></ol><p>	<strong>四、我们如何保存及保护您的个人信息</strong></p><p>	<strong>（一）保存期限。</strong></p><p>	您在使用百度百科产品及服务期间，我们将持续为您保存您的个人信息。如果您注销帐户或主动删除上述信息，百度百科将依据网络安全法等法律法规规定保存您的信息。在您注销帐户或主动删除上述信息后，我们不会再对您的个人信息进行商业化使用，但我们可能会对您的个人信息进行匿名化处理后使用。</p><p>	<strong>（二）保存地域。</strong></p><p>	<strong>您的个人信息均储存于中华人民共和国境内，如部分产品或服务涉及跨境，我们需要向境外传输您的个人信息，我们会严格按照法律法规的规定执行，并保证您的个人信息安全。</strong></p><p>	<strong>（三）安全措施。</strong></p><p><br></p><ol><li class=\"ql-indent-1\">我们会以业界成熟的安全标准和规范收集、使用、存储和传输用户信息，并通过用户协议和隐私政策告知您相关信息的使用目的和范围。</li><li class=\"ql-indent-1\">我们非常重视信息安全。我们成立了专责团队负责研发和应用多种安全技术和程序等，我们会对安全管理负责人和关键安全岗位的人员进行安全背景审查，我们建立了完善的信息安全管理制度和内部安全事件处置机制等。我们会采取适当的符合业界标准的安全措施和技术手段存储和保护您的个人信息，以防止您的信息丢失、遭到被未经授权的访问、公开披露、使用、毁损、丢失或泄漏。我们会采取一切合理可行的措施，保护您的个人信息。我们会使用加密技术确保数据的保密性；我们会使用受信赖的保护机制防止数据遭到恶意攻击。</li><li class=\"ql-indent-1\">我们会对员工进行数据安全的意识培养和安全能力的培训和考核，加强员工对于保护个人信息重要性的认识。我们会对处理个人信息的员工进行身份认证及权限控制，并会与接触您个人信息的员工、合作伙伴签署保密协议，明确岗位职责及行为准则，确保只有授权人员才可访问个人信息。<strong>若有违反保密协议的行为，会被立即终止与百度的合作关系，并会被追究相关法律责任，对接触个人信息人员在离岗时也提出了保密要求</strong>。</li><li class=\"ql-indent-1\">我们提醒您注意，互联网并非绝对安全的环境，<strong>当您通过百度百科中嵌入的第三方社交软件、电子邮件、短信等与其他用户交互您的地理位置或行踪轨迹信息时，不确定第三方软件对信息的传递是否完全加密，注意确保您个人信息的安全</strong>。</li><li class=\"ql-indent-1\">我们也请您理解，在互联网行业由于技术的限制和飞速发展以及可能存在的各种恶意攻击手段，即便我们竭尽所能加强安全措施，也不可能始终保证信息的百分之百安全。请您了解，<strong>您使用我们的产品和/或服务时所用的系统和通讯网络，有可能在我们控制之外的其他环节而出现安全问题</strong>。</li><li class=\"ql-indent-1\">根据我们的安全管理制度，<strong>个人信息泄露、毁损或丢失事件被列为最特大安全事件，一经发生将启动公司最高级别的紧急预案</strong>，由安全部、政府关系部、法务部等多个部门组成联合应急响应小组处理。</li></ol><p>	<strong>（四）安全事件通知</strong></p><p><br></p><ol><li class=\"ql-indent-1\">我们会制定网络安全事件应急预案，及时处置系统漏洞、计算机病毒、网络攻击、网络侵入等安全风险，在发生危害网络安全的事件时，我们会立即启动应急预案，采取相应的补救措施，并按照规定向有关主管部门报告。</li><li class=\"ql-indent-1\">个人信息泄露、毁损、丢失属于公司级特大安全事件，我们会负责定期组织工作组成员进行安全预案演练，防止此类安全事件发生。若一旦不幸发生，我们将按照最高优先级启动应急预案，组成紧急应急小组，在最短时间内追溯原因并减少损失。</li><li class=\"ql-indent-1\">在不幸发生个人信息安全事件后，我们将按照法律法规的要求，及时向您告知安全事件的基本情况和可能的影响、我们已采取或将要采取的处理措施、您可自主防范和降低的风险的建议、对您的补救措施等。我们将及时将事件相关情况以站内通知、短信通知、电话或邮件等您预留的联系方式告知您，难以逐一告知时我们会采取合理、有效的方式发布公告。同时，我们还将按照监管部门要求，主动上报个人信息安全事件的处置情况。</li></ol><p>策</p>', 'Y', '', '2021-08-23 17:00:38', '', '2021-09-11 16:30:21');
INSERT INTO `base_text_content` VALUES ('3', '服务条款', '服务条款', '<p>	请您务必认真阅读本隐私政策，在确认充分了解并同意后使用百度百科服务。此隐私权政策旨在帮助您了解我们会收集哪些数据、为什么收集这些数据，会利用这些数据做些什么及如何保护这些数据。请您务必认真阅读本隐私政策，在确认充分了解并同意后使用百度百科服务。<strong>使用百度百科，即表示您同意百度百科隐私政策。</strong>如果您或您的监护人不同意本隐私政策的任何内容，您应该立即停止使用。</p><p>	请注意：您可以在百科个人中心-设置或产品功能中找到一些控制项，通过这些控制项，您可以对自己的信息进行动态管理。</p><p>	<strong>请注意：《百度隐私权保护声明》适用于百度集团所有产品和服务，如有本隐私政策未尽事宜，以《百度隐私权保护声明》为准，若本隐私政策和《百度隐私权保护声明》存在不一致，则优先适用本隐私政策。</strong></p><p>	<strong>请注意：当您通过百度百科使用第三方产品和服务时，如果向该第三方提供您的个人信息，您的信息将适用该第三方的隐私政策。</strong></p><p>	<strong>请注意：</strong>请您确保您向我们提供的个人信息，以及您授权我们在本隐私政策所述范围内收集、处理、使用、存储、共享、转让或公开披露相关个人信息，不会侵犯他人合法权益。</p><p>	本隐私政策将帮助您了解以下内容：</p><p>	1、我们如何收集和使用您的个人信息</p><p>	2、我们如何使用 Cookie 和同类技术</p><p>	3、我们如何共享、转让、公开披露您的个人信息</p><p>	4、我们如何保存及保护您的个人信息</p><p>	5、您的权利</p><p>	6、我们如何处理儿童的个人信息</p><p>	7、您的个人信息如何在全球范围转移</p><p>	8、隐私政策的修订</p><p>	9、如何联系我们</p><p>	我们深知个人信息对您的重要性，也深知为您的信息提供有效保护是我们业务健康可持续发展的基石。感谢您对百度百科的使用和信任！我们致力于维持您对我们的信任，恪守适用法律和我们对您的承诺，尽全力保证您的个人信息安全和合理使用。</p><p>	我们郑重承诺，<strong>我们将按业界成熟的安全标准，采取相应的安全保护措施来保护您的个人信息。</strong></p><p>	<strong>一、我们如何收集和使用您的个人信息</strong></p><p>	个人信息是指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息。</p><p>	（一） 百度百科业务功能</p><p>	百度百科业务功能包括词条搜索、词条浏览、词条编辑、使用百度百科商城消费、Ta说、搜索推荐：猜你关注、本人词条编辑、第三方服务推荐（均注明服务提供方）。</p><p>	（二） 为您提供我们的产品和服务</p><p>	为了向您提供，并使您获得更好、更个性化的产品和服务，当您使用我们的产品和服务时，我们会以下列方式收集和使用您的个人信息：</p><p>	1.您直接提供和我们自动采集的个人信息</p><p>	(1)<strong>注册信息</strong>。您使用百度百科服务，可以登录经注册的百度通用帐号。当您在百度百科注册百度通用账号时，您需向我们提供以下信息：帐号名称、头像、密保邮箱、密保手机、密保问题，并创建密码；当您直接在百度百科登录百度通用账号时，我们将自动收集您的上述信息。您也可以使用第三方帐号（如微信、微博、QQ）登录百度百科。此时，您将授权百度百科读取您在该第三方帐号注册的公开信息（昵称、头像等）。当然，您未登录百度百科，并不会妨碍您使用百度百科进行词条浏览及搜索，但可能会影响到您使用内容发布等需要经过实名认证才能使用的业务功能。</p><p>	<strong>当您使用百度百科特定业务功能时（如百度百科商城），为遵守国家相关规定并满足向您提供该产品和服务之目的，除注册信息外，您还需要进一步向我们提供包括但不限于您的姓名、住址、联系方式及其他为您提供服务所必须信息，</strong>如果您不使用特定产品和服务，则无需提供相关信息（以下将详细阐明）。</p><p>	百度百科会不时针对新推出的服务和功能发起运营活动，如果您参加相关运营活动，我们会通过运营活动界面收集包括但不限于您的身份信息、联系方式、交易帐号类信息，以便与您取得联系，向您发运营奖励等。若您不参加相关运营活动则无需提供前述信息。</p><p>	<strong>(2)设备和日志信息。</strong>当您使用百度百科的服务时，我们的服务器会自动记录您的日志信息，例如您输入的搜索关键词信息和点击的链接，您浏览和发布的词条及编辑记录，您上传的图片信息、您的IP 地址、浏览器的类型和使用的语言、硬件设备信息、操作系统的版本、网络运营商的信息、您访问服务的日期、时间、时长等。为了给您带来更便捷的搜索服务并不断完善百度百科产品及服务，我们可能会使用浏览器网络存储等机制（包括HTML5）和应用数据缓存，收集您设备上的信息并进行本地存储。</p><p>	(3)<strong>发布内容</strong>。您在使用百度百科的服务时，为履行法律法规要求的信息发布审核、内容管理责任，我们会收集、存储和分析您通过百度百科平台上传和发布的内容（包括词条和文章内容、您上传的视频内容）。您在使用我们的产品和服务时由您主动上传或发布的内容和信息，会使公众可访问，请您谨慎对待。</p><p>	2.我们间接收集的您的信息</p><p>	为共同向您提供产品和服务，或改进产品和服务的质量和个性化程度，或出于对产品和服务安全性的考量等合理需要，我们将按照法律法规的规定或基于您的授权。从关联公司、合作伙伴及其他受信任的第三方供应商处接收您的个人信息及其他信息，并依照您与第三方的约定或本隐私政策使用您的个人信息，两者出现冲突以本隐私政策为准。</p><p>	（三） 为您展示和推送定制内容</p><p>	我们会基于收集的信息，对您的偏好、习惯作特征分析和用户画像，以便为您提供更适合您的定制化服务，例如向您展现或推荐相关程度更高（而非普遍推送）的搜索结果、信息流或者广告/推广信息结果。</p><p>	我们可能向您推荐您可能感兴趣的内容，包括但不限于向您发出产品和服务信息，或通过系统向您展示个性化的第三方推广信息，或者在征得您同意的情况下与百度关联方及合作方共享以便他们向您发送有关其产品和服务的信息。</p><p>	我们可能会将您在百度百科中的画像信息与您在其他百度服务中的信息（包括个人信息）结合起来，以便百度整体能更好地满足您的需求。</p><p>	（四） 改善百度的产品和服务，开展内部审计、数据分析和研究</p><p>	我们使用收集的信息来提供并改进我们及百度关联方提供的产品和服务，并进行必要的业务运营，例如运营产品或提供服务、评估、维护和改进产品和服务的性能，参与有关我们产品和服务的市场调查活动，开发新的产品和服务、提供客户支持等。</p><p>	为改进我们及百度关联方的产品和服务，我们也可能会对产品使用情况进行内部审计、统计和分析。同时，百度可能会与公众共享这些统计信息，以展示我们服务的整体使用趋势，但这些统计信息将不会包含您的任何身份识别信息。</p><p>	（五） 个人信息的匿名化处理</p><p>	在收集到您的个人信息后，我们将通过技术手段及时对数据进行去标识化处理和/或匿名化处理。在不泄露您个人信息的前提下，百度有权对匿名化处理后的用户数据库进行挖掘、分析和利用（包括商业性使用）。</p><p>	（六） 为您提供安全保障</p><p>	我们可能使用您的信息用于安全防范和诈骗监测等，以预防、发现、调查欺诈、危害安全、非法或违反与我们的协议、政策或规则的行为，以保护您、我们或我们的关联公司、合作伙伴及社会公众的合法权益。 （七） 您授权我们在您使用百度百科产品及服务的期间使用您的个人信息，若您注销帐号，我们将停止使用并删除您的个人信息或对您的个人信息进行匿名化处理。</p><p>	（八） 事先征得授权同意的例外</p><p>	1.<strong>请注意，在以下情形中，收集、使用个人信息无需事先征得您的授权同意：</strong></p><p>	(1) 与国家安全、国防安全直接相关的；</p><p>	(2) 与公共安全、公共卫生、重大公共利益直接相关的；</p><p>	(3) 与犯罪侦查、起诉、审判和判决执行等直接有关的；</p><p>	(4) 出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</p><p>	(5) 所收集的个人信息是您自行向社会公众公开的；</p><p>	(6) 从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道；</p><p>	(7) 根据您的要求向您提供产品或服务所必需的；</p><p>	(8) 用于维护所提供的产品或服务的安全稳定运行所必需的，例如发现、处置产品或服务的故障；</p><p>	(9) 法律法规规定的其他情形。</p><p>	（九）<strong>当我们要将信息用于本隐私政策未载明的其它用途时，会事先征求您的同意。当我们要将基于特定目的收集而来的信息用于其他目的时，会事先征求您的同意</strong>。</p><p>	<strong>二、我们如何使用Cookie和同类技术</strong></p><p>	<strong>（一）Cookie</strong></p><p>	为确保网站正常运转，我们会在您的计算机或移动设备上存储名为 Cookie 的小数据文件。Cookie 通常包含标识符、站点名称以及一些号码和字符。Cookie主要的功能是便于您使用网站产品和服务，以及帮助网站统计独立访客数量等。运用Cookie技术，我们能够为您提供更加周到的个性化服务，并允许您设定您特定的服务选项。</p><p>	当您使用百度百科的产品和服务时，会向您的设备发送Cookie。当您与我们提供给合作伙伴的服务（例如广告和/或推广服务，以及可能显示在其他网站上的由百度百科提供的服务功能）进行交互时，我们允许Cookie（或者其他匿名标识符）发送给百度的服务器。</p><p>	我们不会将 Cookie 用于本隐私政策所述目的之外的任何用途。您可根据自己的偏好管理或删除 Cookie。有关详情，请参见 AboutCookies.org。您可以清除计算机上保存的所有 Cookie，大部分网络浏览器都设有阻止 Cookie 的功能。但如果您这么做，则需要在每一次访问我们的网站时亲自更改用户设置，但您可能因为该等修改，无法登录或使用依赖于Cookie的百度提供的服务或功能。</p><p>	您可以通过更改您的浏览器设置限制百度公司对Cookie的使用。以百度浏览器为例，您可以在百度浏览器右上方的下拉菜单的“浏览器设置”中，通过“隐私设置——清除浏览数据”，选择清除您的Cookie。如需详细了解其他浏览器如何更改浏览器设置，请参考该浏览器的帮助中心或其他相关功能指引页面，例如：https://support.google.com/chrome/search?q=cookie ；http://help.opera.com/opera/Windows/2393/en/controlPages.html#manageCookies。]</p><p>	<strong>（二）Do Not Track（请勿追踪）</strong></p><p>	很多网络浏览器均设有 Do Not Track 功能，该功能可向网站发布 Do Not Track 请求。当用户提出 “Do not track” 请求时，具有 “Do not track” 功能的浏览器会在http数据传输中添加一个“头信息”（headers），这个头信息向商业网站的服务器表明用户不希望被追踪，这样，遵守该规则的网站就不会追踪用户的个人信息来用于更精准的在线广告。目前，主要互联网标准组织尚未设立相关政策来规定网站应如何应对此类请求。但如果您的浏览器启用了 Do Not Track，那么百度平台的所有网站都会尊重您的选择。</p><p>	<strong>三、我们如何共享、转让、公开披露您的个人信息</strong></p><p>	<strong>（一）共享</strong></p><p><br></p><ol><li class=\"ql-indent-1\">我们会以高度的勤勉义务对待您的信息。<strong>在获得您的明确同意后，我们会与其他方共享您的个人信息</strong>。我们可能会根据法律法规规定，或按照法律法规、法律程序的要求或强制性的政府要求或司法裁定，对外共享您的个人信息。</li><li class=\"ql-indent-1\">便于我们基于关联账号共同向您提供服务，推荐您可能感兴趣的信息或保护百度关联公司或其他用户或公众的人身财产安全免遭侵害，<strong>我们可能会与关联公司共享您的个人信息。我们只会共享必要的个人信息（如为便于您使用百度账号使用我们关联公司产品和/或服务，我们会向关联公司共享您必要的账户信息）。</strong>如果改变个人信息的共享或使用和处理目的，将再次征求您的授权同意。</li><li class=\"ql-indent-1\">仅为实现本隐私政策中声明的目的，<strong>我们的某些服务将由授权合作伙伴提供。我们可能会与合作伙伴共享您的某些个人信息，以提供更好的客户服务和用户体验</strong>。我们仅会出于合法、正当、必要、特定、明确的目的共享您的个人信息，并且只会共享提供服务所必要的个人信息。我们的合作伙伴无权将共享的个人信息用于任何其他用途。</li><li><strong>您同意我们与如下几类第三方授权合作伙伴共享信息：</strong></li><li class=\"ql-indent-1\"><strong>广告、咨询类服务商/广告主。</strong>未经您授权，我们不会将您的个人信息与提供广告、咨询类服务商共享。但我们可能会将经处理无法识别您的身份且接收方无法复原的信息，例如经匿名化处理的用户画像，与广告或咨询类服务商或广告主共享，以帮助其在不识别您个人的前提下，提升广告有效触达率，以及分析我们的产品和服务使用情况等。</li><li class=\"ql-indent-1\">对我们与之共享个人信息的公司、组织和个人，我们会对其数据安全环境进行调查，与其签署严格的保密协定，要求他们按照我们的说明、本隐私政策以及其他任何相关的保密和安全措施来处理个人信息。</li><li><strong>您主动与他人共享的信息</strong></li><li>(1) 百度百科的成长离不开等各方用户达人的共同努力，我们非常感谢您对百度百科数据更新、使用反馈方面的贡献。</li><li class=\"ql-indent-1\">(2) 您可以利用百度百科的分享功能与您手机通讯录中的联系人、您的特定或不特定社交好友（如微信、微博）共享包括但不限于您的地理位置、您搜索的内容、您的词条贡献等个人信息。<strong>请您在分享前充分考虑信息接收人的信誉情况，并建议您查看您利用的社交网络或第三方服务提供商的隐私声明</strong>，以了解他们如何处理您的信息，以便审慎决策。</li></ol><p>	<strong>（二）转让</strong></p><p><br></p><ol><li>我们不会将您的个人信息转让给除<strong>百度关联公司</strong>外的任何公司、组织和个人，但以下情况除外：</li><li>(1) 事先获得您的明确授权或同意；</li><li>(2) 满足法律法规、法律程序的要求或强制性的政府要求或司法裁定；</li><li class=\"ql-indent-1\">(3) 如果我们或我们的关联公司涉及合并、分立、清算、资产或业务的收购或出售等交易，您的个人信息有可能作为此类交易的一部分而被转移，我们将确保该等信息在转移时的机密性，并尽最大可能确保新的持有您个人信息的公司、组织继续受此隐私政策的约束，否则我们将要求该公司、组织重新向您征求授权同意。</li></ol><p>	<strong>（三）公开披露</strong></p><p><br></p><ol><li><strong>我们仅会在以下情况下，公开披露您的个人信息：</strong></li><li>(1) 获得您的明确同意；</li><li class=\"ql-indent-1\">(2) 基于法律法规、法律程序、诉讼或政府主管部门强制性要求下。</li></ol><p>	<strong>（四）共享、转让、公开披露个人信息时事先征得授权同意的例外</strong></p><p><br></p><ol><li>在以下情形中，共享、转让、公开披露个人信息无需事先征得个人信息主体的授权同意：</li><li>(1) 与国家安全、国防安全直接相关的</li><li>(2) 与公共安全、公共卫生、重大公共利益直接相关的；</li><li>(3) 与犯罪侦查、起诉、审判和判决执行等直接相关的；</li><li class=\"ql-indent-1\">(4) 出于维护个人信息主体或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；个人信息主体自行向社会公众公开的个人信息；从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。</li></ol><p>	<strong>四、我们如何保存及保护您的个人信息</strong></p><p>	<strong>（一）保存期限。</strong></p><p>	您在使用百度百科产品及服务期间，我们将持续为您保存您的个人信息。如果您注销帐户或主动删除上述信息，百度百科将依据网络安全法等法律法规规定保存您的信息。在您注销帐户或主动删除上述信息后，我们不会再对您的个人信息进行商业化使用，但我们可能会对您的个人信息进行匿名化处理后使用。</p><p>	<strong>（二）保存地域。</strong></p><p>	<strong>您的个人信息均储存于中华人民共和国境内，如部分产品或服务涉及跨境，我们需要向境外传输您的个人信息，我们会严格按照法律法规的规定执行，并保证您的个人信息安全。</strong></p><p>	<strong>（三）安全措施。</strong></p><p><br></p><ol><li class=\"ql-indent-1\">我们会以业界成熟的安全标准和规范收集、使用、存储和传输用户信息，并通过用户协议和隐私政策告知您相关信息的使用目的和范围。</li><li class=\"ql-indent-1\">我们非常重视信息安全。我们成立了专责团队负责研发和应用多种安全技术和程序等，我们会对安全管理负责人和关键安全岗位的人员进行安全背景审查，我们建立了完善的信息安全管理制度和内部安全事件处置机制等。我们会采取适当的符合业界标准的安全措施和技术手段存储和保护您的个人信息，以防止您的信息丢失、遭到被未经授权的访问、公开披露、使用、毁损、丢失或泄漏。我们会采取一切合理可行的措施，保护您的个人信息。我们会使用加密技术确保数据的保密性；我们会使用受信赖的保护机制防止数据遭到恶意攻击。</li><li class=\"ql-indent-1\">我们会对员工进行数据安全的意识培养和安全能力的培训和考核，加强员工对于保护个人信息重要性的认识。我们会对处理个人信息的员工进行身份认证及权限控制，并会与接触您个人信息的员工、合作伙伴签署保密协议，明确岗位职责及行为准则，确保只有授权人员才可访问个人信息。<strong>若有违反保密协议的行为，会被立即终止与百度的合作关系，并会被追究相关法律责任，对接触个人信息人员在离岗时也提出了保密要求</strong>。</li><li class=\"ql-indent-1\">我们提醒您注意，互联网并非绝对安全的环境，<strong>当您通过百度百科中嵌入的第三方社交软件、电子邮件、短信等与其他用户交互您的地理位置或行踪轨迹信息时，不确定第三方软件对信息的传递是否完全加密，注意确保您个人信息的安全</strong>。</li><li class=\"ql-indent-1\">我们也请您理解，在互联网行业由于技术的限制和飞速发展以及可能存在的各种恶意攻击手段，即便我们竭尽所能加强安全措施，也不可能始终保证信息的百分之百安全。请您了解，<strong>您使用我们的产品和/或服务时所用的系统和通讯网络，有可能在我们控制之外的其他环节而出现安全问题</strong>。</li><li class=\"ql-indent-1\">根据我们的安全管理制度，<strong>个人信息泄露、毁损或丢失事件被列为最特大安全事件，一经发生将启动公司最高级别的紧急预案</strong>，由安全部、政府关系部、法务部等多个部门组成联合应急响应小组处理。</li></ol><p>	<strong>（四）安全事件通知</strong></p><p><br></p><ol><li class=\"ql-indent-1\">我们会制定网络安全事件应急预案，及时处置系统漏洞、计算机病毒、网络攻击、网络侵入等安全风险，在发生危害网络安全的事件时，我们会立即启动应急预案，采取相应的补救措施，并按照规定向有关主管部门报告。</li><li class=\"ql-indent-1\">个人信息泄露、毁损、丢失属于公司级特大安全事件，我们会负责定期组织工作组成员进行安全预案演练，防止此类安全事件发生。若一旦不幸发生，我们将按照最高优先级启动应急预案，组成紧急应急小组，在最短时间内追溯原因并减少损失。</li><li class=\"ql-indent-1\">在不幸发生个人信息安全事件后，我们将按照法律法规的要求，及时向您告知安全事件的基本情况和可能的影响、我们已采取或将要采取的处理措施、您可自主防范和降低的风险的建议、对您的补救措施等。我们将及时将事件相关情况以站内通知、短信通知、电话或邮件等您预留的联系方式告知您，难以逐一告知时我们会采取合理、有效的方式发布公告。同时，我们还将按照监管部门要求，主动上报个人信息安全事件的处置情况。</li></ol>', 'Y', '', '2021-08-23 17:00:55', '', '2021-12-04 10:36:10');
INSERT INTO `base_text_content` VALUES ('4', '考试须知', '考试须知', '<p>	<strong>考试内容、费用</strong></p><p>1.考试内容：公共科目考试</p><p>公共科目包括行政职业能力测验和申论两科。其中，行政职业能力测验为客观性试题，申论为主观性试题，满分均为100分。</p><p>2.费用：免费。</p><p><strong>考生责任</strong></p><p>1.&nbsp;保证注册时提交的个人信息、资料真实、正确，并将对个人信息、资料不真实或不正确而导致无法参加考试以及其他直接或间接的后果负责。</p><p>2.保证不利用本平台从事违反法律、法规和政策规章的活动。</p><p>3.保证不进行针对本平台的任何恶意行为，对于破坏本平台的恶意行为，将依法追究其相应法律责任。</p><p>4. 承诺已认真阅读本须知，并点击“同意并报考”选项之后，完全接受协议各条款的约束。</p><p><strong>个人隐私保护</strong></p><p>1.我方承诺尊重和保护考生个人隐私，不对社会公众公开其个人信息资料。但此承诺在下列情况下自动失效：</p><p>（1）经考生同意公开的。</p><p>（2）在符合国家政策和法律的情况下，拥有合法调查权的国家机关索取考生个人信息。</p><p>（3）因考生操作不当所导致的个人信息泄漏。</p><p>（4）非因甲方过错导致考生信息的泄露。</p><p>2.我方系统维护、组织考试等内部管理工作需要，在相应工作范围内使用并公开考生个人信息料不受本协议的约束。</p><p><strong>密码和安全性</strong></p><p>1.禁止使用他人身份登录系统享受系统提供的服务。</p><p>2.考生注册成功后，将使用考生输入的姓名、证件号和自设定的密码作为登录本网站的依据。须妥善保管自设定的密码和输入的姓名、证件号并保证不向任何他人透露。否则，考生对自己的密码安全保管不善所造成的损失，由其本人对此产生的所有后果负责。</p><p>3.考生如发现任何程序问题或安全漏洞情况，请立即通知我方。</p><p><strong>知识产权</strong></p><p><span style=\"color: rgb(51, 51, 51);\">考生应尊重甲方知识产权，对甲方提供的考试信息、考卷内容等予以保密，不以任何</span>方式或理由将试题内容进行抄录、复制、传播<span style=\"color: rgb(51, 51, 51);\">、销售或提供给他人使用，否则将构成侵权，并承担相应责任。</span></p><p><strong>法律责任</strong></p><p>1.考生在报名成功后，因本网站系统出现异常问题而影响考生本人报名或参加考试，我方应安排重新报名，除此之外不承担任何其他责任。</p><p>2.凡申请报名者在网上提交报名表后，即视为同意本协议及本网站报名系统中一切报名相关的文字说明内容并承诺遵行。</p><p>3.双方因本协议引起的或与本协议有关的任何争议，均提请北京仲裁委员会按照其仲裁规则进行仲裁。仲裁裁决是终局的，对双方均有约束力。</p>', 'Y', '', '2021-08-23 17:01:11', '', '2021-09-15 10:33:28');
INSERT INTO `base_text_content` VALUES ('5', '联系我们', '联系我们', '<p>	请您务必认真阅读本隐私政策，在确认充分了解并同意后使用百度百科服务。此隐私权政策旨在帮助您了解我们会收集哪些数据、为什么收集这些数据，会利用这些数据做些什么及如何保护这些数据。请您务必认真阅读本隐私政策，在确认充分了解并同意后使用百度百科服务。<strong>使用百度百科，即表示您同意百度百科隐私政策。</strong>如果您或您的监护人不同意本隐私政策的任何内容，您应该立即停止使用。</p><p>	请注意：您可以在百科个人中心-设置或产品功能中找到一些控制项，通过这些控制项，您可以对自己的信息进行动态管理。</p><p>	<strong>请注意：《百度隐私权保护声明》适用于百度集团所有产品和服务，如有本隐私政策未尽事宜，以《百度隐私权保护声明》为准，若本隐私政策和《百度隐私权保护声明》存在不一致，则优先适用本隐私政策。</strong></p><p>	<strong>请注意：当您通过百度百科使用第三方产品和服务时，如果向该第三方提供您的个人信息，您的信息将适用该第三方的隐私政策。</strong></p><p>	<strong>请注意：</strong>请您确保您向我们提供的个人信息，以及您授权我们在本隐私政策所述范围内收集、处理、使用、存储、共享、转让或公开披露相关个人信息，不会侵犯他人合法权益。</p><p>	本隐私政策将帮助您了解以下内容：</p><p>	1、我们如何收集和使用您的个人信息</p><p>	2、我们如何使用 Cookie 和同类技术</p><p>	3、我们如何共享、转让、公开披露您的个人信息</p><p>	4、我们如何保存及保护您的个人信息</p><p>	5、您的权利</p><p>	6、我们如何处理儿童的个人信息</p><p>	7、您的个人信息如何在全球范围转移</p><p>	8、隐私政策的修订</p><p>	9、如何联系我们</p><p>	我们深知个人信息对您的重要性，也深知为您的信息提供有效保护是我们业务健康可持续发展的基石。感谢您对百度百科的使用和信任！我们致力于维持您对我们的信任，恪守适用法律和我们对您的承诺，尽全力保证您的个人信息安全和合理使用。</p><p><br></p>', 'Y', '', '2021-08-23 17:01:24', '', '2022-03-18 17:02:50');
INSERT INTO `base_text_content` VALUES ('6', '登录服务条款', '登录服务条款', '<p>感谢您使用快抖赢客通（以下简称“赢客通”）服务！</p><p>我们会根据有关法律法规的变化、公司经营状况、经营策略调整和软件升级等原因修订本协议。更新后的协议条款公布后即有效代替原来的协议条款。如果您不同意协议改动内容，请您立即停止使用本服务。如果您继续使用本服务，则视为接受本协议的改动。</p><p>请您务必审慎阅读、充分理解各条款内容，特别提示您关注：关于限制、免责、违规/违约行为的认定处理、以及管辖法院的选择等条款内容，前述条款可能以加粗及/或加下划线形式提示您注意。</p><p>除非您已阅读并接受本协议及相关协议、规则等所有条款，否则，您无权使用本服务。您使用本服务，即视为您已阅读并同意上述协议、规则等的约束。</p><p>您有任何违反本协议的行为时，咕果有权根据违约情节，随时单方限制、中止或终止向您提供本服务，并有权追究您的相关责任。</p><h4>第一条 赢客通服务内容</h4><p>1.1抖音账号常规建设服务内容：</p><p>1.1.1 咕果向您提供企业抖音账号搭建服务，包括账号头图设计、账号头像、账号签名、蓝V辅助认证（认证费用需您支付），以上服务需您配合提供您企业真实准确的资料及信息，否则，此项服务将无法为您提供。</p><p>1.1.2 企业抖音账号下的视频制作，咕果将提供入企拍摄服务，发布条数将按照您购买的套餐版本中视频发布标准进行发布，超出部分需要您另行支付服务费用</p><p>1.2 垂类推广账号资源使用服务：</p><p>1.2.1 咕果向您提供垂类行业推广账号，推广账号数以赢客通平台账号数量为准，您可通过赢客通平台推广企业宣传视频，您需保证您自行发布的视频及文案内容和修改内容符合法律规定，不侵犯任何第三方的合法权益，您对该内容产生的一切问题承担全部法律责任。</p><p>1.2.2 套餐中推广账号发布的视频条数为最大可发布条数，超出套餐规定额度将无法继续发布。</p><p>1.2.3 咕果仅向机构提供推广账号信息展示服务，因机构虚假夸大宣传、欺诈用户等自身行为所引起的一切法律纠纷由您自行承担，与咕果无关。</p><p>1.3 线索收集服务：</p><p>1.3.1 咕果向您提供数据收集服务，此数据仅供您参考使用，您在使用此类数据时不得违反任何国家有关法律、法规及中华人民共和国承认或加入的国际条约的内容，包括但不限于危害国家安全、淫秽色情、虚假、侮辱、诽谤、恐吓或骚扰、侵犯第三方知识产权、人身权或其他合法权益以及有违社会公序良俗的行为。</p><p>1.3.2 双方合作信息以及机构从咕果获得的用户信息，未经咕果同意，机构不得对外披露或在协议目的外使用。</p><h4>服务条款：</h4><p>此条款与合同条款一致。</p><p>一、双方的权利义务：</p><p>1. 甲方不得利用乙方提供的软件服务进行违反国家相关法律法规或违背公序良俗的活动，否则乙方将有权立刻停止对甲方提供的系统服务，所有责任由甲方承担。</p><p>2. 甲方必须按照乙方的要求及时提供准确、真实、有效的信息和权限，如果因为甲方提供的内容在真实性、准确性、时效性产生的问题乙方不承担任何责任。</p><p>3. 在日常工作时间，乙方向甲方提供相关技术系统的培训服务和与产品相关的问题解答。</p><p>4. 甲方对乙方提供的平台软件改动时需及时通知乙方，在乙方得知并同意的情况下方可执行，若因甲方私自调整修改造成软件无法使用或产生其他不良后果所有责任由甲方自行承担，乙方并有权立刻停止对甲方提供的所有服务。</p><p>5. 服务期满后，如甲方还需要乙方继续提供有关服务，则双方应重新签订合作协议并交纳相应的费用，否则将视为终止协议，乙方有权停止所有向甲方提供的产品和服务。</p><p>二、违约责任：</p><p>1. 甲方如违反合同有关规定，乙方有权暂停相关服务并有权单方解除合同，一切已缴付的费用将不予退还。</p><p>2. 甲方自行发布的信息或内容，引起纠纷的，责任全部由甲方承担。</p><p>3. 如果因乙方失误，给予甲方造成域名失效无法使用的情况，乙方将给予甲方赔偿不高于域名注册登记费用的五倍赔偿。</p><p>三、合同的终止:</p><p>1、 如果甲方未能按照“二、报酬及支付方式”支付所列出的费用，乙方有权拒绝提供相关服务并有权单方面解除本合同。</p><p>2、 如果发生下列任何一种情况，甲、乙任何一方有权解除本合同。</p><p>1) 有其他违约行为致使本合同不能实现的。</p><p>2) 甲、乙双方有任何一方因不可抗力的因素，致使本合同不能实现的。</p><p>3) 甲、乙双方任何一方严重违反其合同中所作出的声明和保证的。</p><p>四、保密条款:</p><p>甲方在合同有效期内，不得以任何形式、任何理由将本协议内容及优惠金额透漏给第三方，但依据双方书面约定、依据法律法规，或者依据司法和/或政府机关的要求进行披露的除外；否则，乙方有权利终止合同并赔偿因此造成的损失。</p><p>五、适用法律:</p><p>本合同受中华人民共和国法律管辖并按其进行解释。如果甲、乙双方在执行本合同的过程中发生纠纷或争议，甲、乙双方尽量通过友好的的方式进行协商解决；如协商不成，甲、乙双方或其中一方有权将争议或纠纷提供乙方所在地有管辖权的人民法院进行诉讼。</p>', 'Y', '', '2021-09-15 19:36:13', '', null);
